import React from 'react'
import { useState } from 'react'
// import Toggle from './components/toogle/Toggle'

const App = () => {
  const [show, setShow] = useState(false)
  return (
    <div>
      {/* <Toggle /> */}
      {show ? <h1>Here is my Text</h1> : ''}
      <button>Hide</button>
      <button>Show</button>
    </div>
  )
}

export default App
